import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  width: 100%;
  height: 897px;
  & > .top {
    height: 724px;
    padding-top: 102px;
    box-sizing: border-box;
    padding-bottom: 160px;
    & > .container {
      display: flex;
      align-items: center;
      & > .left {
        & > .title {
          font-size: 46px;
          font-weight: bold;
          line-height: 1.3;
          color: #191f28;
          font-family: "cafe24";
          & > span {
            color: #007fff;
          }
        }
        & > .sub {
          margin-top: 15px;
          font-size: 18px;
          font-weight: 500;
          line-height: 1.61;
          color: #191f28;
        }
      }
    }
  }
  & > .bottom {
    height: 173px;
    background-color: #282a2b;
  }
`;

function Section6() {
  return (
    <Wrapper>
      <div className="top">
        <div className="container">
          <div className="left">
            <div className="title">
              내 <span>단골</span>은 <br /> 스스로 관리하자!
            </div>
            <div className="sub">
              플랫폼이나 외부 프로그램이 아닌 점주가 스스로 <br /> 관리할 수
              있어 간편하게 배달시장에 진입 및 <br /> 독립성을 확보할 수
              있습니다.
            </div>
          </div>
        </div>
      </div>
      <div className="bottom">
        <div className="container">
          <div className="left"></div>
          <button></button>
        </div>
      </div>
    </Wrapper>
  );
}

export default Section6;
